import Link from 'next/link';
import Navstyles from './styles/NavStyles';

const Nav = () => (
    <Navstyles>
        <Link href="/">
            <a>Go to Home</a>
        </Link>

        <Link href="/sell">
            <a>Go to Sell</a>
        </Link>


    </Navstyles>
)

export default Nav;
